import React from 'react'
import { CompanyKeyMetrics } from '../../company';
type Props = {};

const tableConfig = [
  {
    label: "Enterprise Value",
    render: (company: CompanyKeyMetrics) => 
      company.enterpriseValueTTM,
    subTitle: "Total company value (market cap + debt - cash)",
  },
  {
    label: "Current Ratio",
    render: (company: CompanyKeyMetrics) =>
      company.currentRatioTTM, 
    subTitle: "Способность покрывать краткосрочные обязательства",
  },
  {
    label: "Return On Equity",
    render: (company: CompanyKeyMetrics) => 
      company.returnOnEquityTTM, 
    subTitle: "Доходность собственного капитала",
  },
  {
    label: "Return On Tangible Assets",
    render: (company: CompanyKeyMetrics) =>
      company.returnOnTangibleAssetsTTM,
    subTitle: "Рентабельность материальных активов",
  },
  {
    label: "Free Cashflow Per Share",
    render: (company: CompanyKeyMetrics) =>
      company.freeCashFlowPerShareTTM,
    subTitle: "Свободный денежный поток на акцию",
  },
  {
    label: "Price to Book Value",
    render: (company: CompanyKeyMetrics) =>
      company.priceToBookRatioTTM, // Было bookValuePerShareTTM -> исправлено на priceToBookRatioTTM
    subTitle: "Отношение цены к балансовой стоимости",
  },
  {
    label: "Dividend Yield TTM",
    render: (company: CompanyKeyMetrics) =>
      company.dividendYieldTTM, // Добавлен формат процентов
    subTitle: "Дивидендная доходность",
  },
  {
    label: "PE Ratio",
    render: (company: CompanyKeyMetrics) => 
      company.priceToEarningsRatioTTM, // Было peRatioTTM -> исправлено на priceToEarningsRatioTTM
    subTitle: "Отношение цены к прибыли",
  },
  {
    label: "Debt to Equity",
    render: (company: CompanyKeyMetrics) =>
      company.debtToEquityRatioTTM,
    subTitle: "Соотношение заемного и собственного капитала",
  }
];

const CompanyProfile = (props: Props) => {
  return (
    <div>CompanyProfile</div>
  )
}

export default CompanyProfile
